import Potato from "./Potato";

function Food({ name }) {
  return <h1>I Like {name}</h1>;
}

const foodILike = [
  { name: "김치", image: "" },
  { name: "t", image: "" },
  { name: "김치", image: "" },
  { name: "김치", image: "" },
];

function renderFood(dish) {
  return <Food key={dish.name} name={dish.name} picture={dish.image} />;
}

function App() {
  return (
    <div className="App">
      Hello!!! <Potato />
      {foodILike.map(renderFood)}
    </div>
  );
}

export default App;
